import React from "react";
import profileImg from '../data/work.jpeg';

function Home() {
  return (
    <section id="about">
      <div className="container m-auto max-w-screen-xl">
        <div className="grid grid-cols-1 md:grid-cols-2">
          <div className="inline-block mt-8 mb-8">
            <img className="object-contain object-top rounded-full m-auto"
                 src={profileImg}
                 alt=""/>
          </div>
          <div className="flex bg-gray-100 p-10">
            <div className="mb-auto mt-auto max-w-lg">
              <h1 className="text-3xl uppercase">Daniel Bello</h1>
              <p className="font-semibold mb-5">Magento Frontend Developer</p>
              <p>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Donec odio. Quisque volutpat mattis eros.
                Nullam malesuada erat ut turpis. Suspendisse urna nibh, viverra non, semper suscipit, posuere a,
                pede.</p>
              <button className="bg-gray-900 rounded-md py-3 px-7 mt-6 text-white">Email Me</button>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Home;
